pragma solidity ^0.8.6;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./IGenomMining.sol";

/**
 * @dev ASM AIFA All-Stars claim contract
 */
contract GenomMining is IGenomMining, Pausable, Ownable {
    using SafeERC20 for IERC20;

    bool isInitialized = false;

    // all variables are public to make them available in tests
    uint256 public constant DAYS_PER_WEEK = 7;
    uint256 public constant HOURS_PER_DAY = 24;
    uint256 public constant MINUTES_PER_HOUR = 60;
    uint256 public constant SECONDS_PER_MINUTE = 60;
    uint256 public constant SECONDS_PER_HOUR = 3600;
    uint256 public constant SECONDS_PER_DAY = 86400;
    uint256 public constant SECONDS_PER_WEEK = 604800;
    uint256 public constant DURATION_WEEKS = 40;
    uint256 public constant DURATION_SECONDS =
        DURATION_WEEKS * SECONDS_PER_WEEK;

    IERC20 public immutable astoTokenAddress;
    IERC20 public immutable lpTokenAddress;
    uint256 public astoClaimed;

    mapping(uint256 => bool) public staked; // ! What if it was staked monday
    mapping(uint256 => bool) public claimed; // ! then claimed Tuesday, and staked again Wednesday?

    uint256 public startTime; // unix epoch time in seconds

    /**
     * @notice Initialize the contract
     * @param multisig Multisig address as the contract owner
     * @param _astoTokenAddress $ASTO contract address
     * @param _lpTokenAddress ASM All-Stars contract address
     */
    constructor(
        address multisig,
        IERC20 _astoTokenAddress,
        IERC20 _lpTokenAddress
    ) {
        require(address(multisig) != address(0), "invalid multisig address");
        require(
            address(_astoTokenAddress) != address(0),
            "invalid ASTO address"
        );
        require(address(_lpTokenAddress) != address(0), "invalid LP address");

        // mainnet: 0x823556202e86763853b40e9cDE725f412e294689
        astoTokenAddress = _astoTokenAddress;
        // mainnet: 0x11181bD3BAF5cE2A478E98361985d42625DE35D1
        lpTokenAddress = _lpTokenAddress;
        astoClaimed = 0;
        _pause();
        _transferOwnership(multisig);
    }

    /** ----------------------------------
     * ! Only owner functions
     * ----------------------------------- */

    /**
     * @notice Withdraw ASTO tokens left in the contract to multisig
     * @param amount Token amount to withdraw
     */
    function withdrawASTOTokens(address recipient, uint256 amount)
        external
        onlyOwner
    {
        require(
            astoTokenAddress.balanceOf(address(this)) > 1,
            "Insufficient LP token balance"
        );
        astoTokenAddress.approve(recipient, amount);
        astoTokenAddress.transferFrom(address(this), recipient, amount);
    }

    /**
     * @notice Withdraw LP tokens left in the contract to multisig
     * @param amount Token amount to withdraw
     */
    function withdrawLpTokens(address recipient, uint256 amount)
        external
        onlyOwner
    {
        require(
            lpTokenAddress.balanceOf(address(this)) > 1,
            "Insufficient LP token balance"
        );
        lpTokenAddress.approve(recipient, amount);
        lpTokenAddress.transferFrom(address(this), recipient, amount);
    }

    /**
     * @notice Set start time for staking/claiming
     * @notice Pausing contract doesn't prolong staking/claiming period
     * @param newStartTime The auction start timestamp to set
     */
    function setStartTime(uint256 newStartTime) external onlyOwner {}

    /** ----------------------------------
     * ! Modifiers
     * ----------------------------------- */

    /**
     * @notice
     */
    modifier whenAllowed() {
        require(!paused(), "All-Stars Claim: paused");
        // require(isActive(), "All-Stars Claim: is not active");  // `startTime` is set, and 40 weeks are not over
        _;
    }
}
